import React from "react";
import Text from "../Text/Text"

const Page = () => {

    return (
        <>
            <Text type="h1">H1</Text>
            <Text type="h2">H2</Text>
            <Text type="h3">H3</Text>
            <Text type="h4">H4</Text>
            <Text type="a">A</Text>
            <Text type="span">SPAN</Text>
            <Text type="paragraph">P</Text>
        </>
    )
}

export default Page
